import React, {useContext, useState} from 'react';
import PlanetImg from '../../assets/pics/planet.jpg';
import {PlanetsContext} from './PlanetsContext.js'; 

const Planets = () => {

	const {planetsTab} = useContext(PlanetsContext);

	const planets = (

		planetsTab.map((planet, index) => (
			<div key={planet.Id} classNames={'planet ' + planet.number} onClick={() => console.log(index)}>
				<img className='planetImg' src={PlanetImg} alt={planet.id}/>
			</div>
			)
		)
	);

	return (
		<div>
			{planets}		
		</div>
	)
};
export default Planets
